import styled from "styled-components";

const Container = styled.div`
  display: flex;
  align-items: center;
  justify-content: space-between;

  width: 100%;
  height: 400px;
  background-color: red;

  position: fixed;
  bottom: 0;
`;

const Contato = styled.div``;

const Social = styled.div``;

export { Container, Contato, Social };
